webpackJsonp([0x81b8806e4260],{321:function(n,t){n.exports={data:{first:{edges:[{node:{id:"/home/alex/Projects/cv/src/markdown/person.md absPath of file >>> MarkdownRemark",frontmatter:{position:200,title:"Person",links:[{href:"mailto:jenteralex@gmail.com?subject=Hey, nice CV!",text:"Email"},{href:"https://github.com/AlexJenter",text:"Github"}]},html:"<p>Web developer with a background in design</p>"}}]},rest:{edges:[{node:{id:"/home/alex/Projects/cv/src/markdown/work.md absPath of file >>> MarkdownRemark",frontmatter:{position:300,title:"Work"},html:'<h3>apr \'21 – now <strong><a href="https://www.kunstbetrieb.ch/">kunstbetrieb</a></strong></h3>\n<span>\n<p><strong>Technical Lead / Digital Artist</strong> – Using my in background design combined with my passion for tech to help artists make art</p>\n<ul>\n<li>3D Data aquirement, processing and modelling</li>\n<li>CAD, simulations and dynamics</li>\n<li>Generative / procedural design</li>\n<li>Consulting on matters of production</li>\n</ul>\n</span>\n<h3>sep \'18 – feb \'21 <strong><a href="https://www.hinderlingvolkart.com/">hinderlingvolkart</a></strong></h3>\n<span>\n<p><strong>Full stack developer</strong> – Building backends and defining processes in one of the leading swiss digital agencies.</p>\n<ul>\n<li>Infrastructure</li>\n<li>Operations</li>\n<li>Working in a larger team</li>\n<li>High profile clients</li>\n</ul>\n</span>\n<h3>dec \'15 – aug \'18 <strong><a href="https://www.attribute.ch">attribute</a></strong></h3>\n<span>\n<p><strong>Web developer</strong> – Focused on frontend with the occasional opportunity to work with react or canvas on the job.</p>\n<ul>\n<li>UX</li>\n<li>Information architecture</li>\n<li>Concept</li>\n<li>Working with a variety of clients</li>\n</ul>\n</span>\n<h3>dec \'14 – dec \'15 <strong><a href="http://www.pdz.ethz.ch/">eth pdz zurich</a></strong></h3>\n<span>\n<p><strong>Scientific Assistant</strong> – Consulting for all things design at the pd|z Product Development Group Zurich headed by Prof. Dr. Mirko Meboldt.</p>\n<ul>\n<li>Rapid manufacturing</li>\n<li>Video editing</li>\n<li>3D Printing</li>\n<li>Web development</li>\n</ul>\n</span>\n<h3>jun \'14 – nov \'14 <strong><a href="https://fotokite.com/">FOTOKITE</a></strong></h3>\n<span>\n<p><strong>Head of Design</strong> – Responsible for the design of early mockups, 3D printed prototypes and protective shells at Sergei Lupashin\'s ETH spin-off.</p>\n<ul>\n<li>Design consultancy</li>\n<li>Marketing</li>\n<li>UI</li>\n</ul>\n</span>\n<h3>FEB \'14 – SEP \'14 <strong><a href="https://www.thisweber.com/">THIS WEBER</a></strong></h3>\n<span>\n<p><strong>Industrial Designer</strong> – Drafting of plans and CAD drawings for Möbel Pfister\'s furniture collection.</p>\n<ul>\n<li>3d visualisation</li>\n<li>Documentation &#x26; specification</li>\n</ul>\n</span>\n<h3>SEP \'13 – JAN \'14 <strong><a href="https://industrialdesign.zhdk.ch/">ZHDK VID</a></strong></h3>\n<span>\n<p><strong>Scientific Assistant</strong> – Technical assistance including usage of tools such as Rhino3D and Grasshopper in a professional context.</p>\n<ul>\n<li>Design automation</li>\n<li>Experimental workflow</li>\n</ul>\n</span>\n<h3>SEP \'12 – MAY \'13 <strong><a href="http://www.christophemarchand.ch/">CHRISTOPHE MARCHAND</a></strong></h3>\n<span>\n<p><strong>Project Partner</strong> – Applying my ideas of automated design variant generation to a business case in the renowned atelier of Christophe Marchand.</p>\n<ul>\n<li>Generative / procedural design</li>\n</ul>\n</span>\n<h3>MAY \'12 – JUN \'12 <strong><a href="https://www.zkb.ch">ZKB</a></strong></h3>\n<span>\n<p><strong>Project Lead</strong> – Commissioned, after winning a student competition, with the design and execution of the first prize trophy for the <a href="https://www.zkb.ch/de/uu/sp/umwelt-mobilitaet/umweltschutz/nachhaltigkeitspreis">ZKB sustainability award</a> for small and medium-sized enterprises.</p>\n<ul>\n<li>3D Print and mold making</li>\n<li>Molding techniques</li>\n<li>Direct client contact</li>\n</ul>\n</span>\n<h3>JUN \'11 – AUG \'11 <strong><a href="https://www.quo.ch/en/">QUO</a></strong></h3>\n<span>\n<p><strong>Industrial Design Intern</strong> – Design and model making for a gait trainer, graphic design for the corresponding CTI poster, design and technical solutions for a humanoid robot</p>\n<ul>\n<li>Project work in the field</li>\n<li>Constructional drawing</li>\n</ul>\n</span>\n<h3>JUN \'99 – AUG \'03 <strong><a href="https://lohrer.ch/">NORBERT LOHRER</a></strong></h3>\n<span>\n<p><strong>Apprenticeship as a carpenter</strong> – (Eidg. dipl.) Working on small-scale furniture production and high quality interiors</p>\n<ul>\n<li>Attention to detail</li>\n<li>Batch production</li>\n</ul>\n</span>'}},{node:{id:"/home/alex/Projects/cv/src/markdown/education.md absPath of file >>> MarkdownRemark",frontmatter:{position:400,title:"Education"},html:"<h3>SEP '09 – MAY '12 <strong><a href=\"https://industrialdesign.zhdk.ch/\">ZHDK VID</a></strong></h3>\n<p><strong>Bachelor of Arts</strong> – in Product and Industrial Design at Zurich University of the Arts</p>\n<h3>AUG '08 – JUN '09 <strong><a href=\"https://www.bbw.ch/\">BBW</a></strong></h3>\n<p><strong>Berufsmaturität</strong> – Berufsbildungsschule Winterthur BBW</p>\n<h3>AUG '99 – AUG '03 <strong><a href=\"https://www.bbw.ch/\">BBW</a></strong></h3>\n<p><strong>Apprenticeship</strong> – as Eidg. dipl. Carpenter, Berufsbildungsschule Winterthur BBW</p>\n<h3>AUG '98 – AUG '99 <strong><a href=\"https://www.zur-oase.ch/\">Oase</a></strong></h3>\n<p><strong>Social Internship</strong> – as Guardian, Wohngemeinschaft Oase, Gais AR</p>\n<h3>JUN '97 – JUN '98 <strong><a href=\"https://ffzh.ch/\">F+F</a></strong></h3>\n<p><strong>Preparatory Programme</strong> – (Vorkurs) Farb und Form Schule Zürich</p>"}},{node:{id:"/home/alex/Projects/cv/src/markdown/languages.md absPath of file >>> MarkdownRemark",frontmatter:{position:500,title:"Languages"},html:"<p>Fluent in English and German, conversational skills in French</p>"}}]}},pathContext:{}}}});
